import React from "react";
import TicketList from "./TicketList";

export default function TicketsPage() {
    return (
        <div className="min-h-screen bg-cover bg-center flex items-center justify-center p-6 relative" style={{ backgroundImage: 'url("https://images.unsplash.com/photo-1554907984-15263bfd63bd?q=80&w=2670&auto=format&fit=crop")' }}>
            <div className="absolute inset-0 bg-black/60 backdrop-blur-sm"></div>

            <div className="relative z-10 w-full max-w-4xl">
                <h1 className="text-4xl font-bold text-white mb-8 text-center">My Tickets & Bookings</h1>
                <div className="bg-white/90 backdrop-blur-md rounded-2xl p-8 shadow-2xl">
                    <TicketList />
                </div>
            </div>
        </div>
    );
}
